ported w\'\'\'\'hite oak casks and fused with premium Scotch. The pronounced malt and rich wood aroma, with a whiff of peat and heather supplements the fantasy while its subtle nuances come from the choicest components of the blend, giving it a full smooth flavour and a bouquet that proclaims its royal pedigree. Truly India finest.\r\n\r\nNote: Drink responsibly. Offer only for people over legal drinking age in the state. Do not share offer with people under legal drinking age.\'','cxvxcv','xcvxcv','cvcxv','xcvxcv','xcvcxv','6bba8df5-ef94-4dd8-b2fa-9c7a49f82439-large.jpeg','cxxcv','cxcvcxv','cxvxcv','cxvcxv','cvcxv','cvcxv','cxvxcv','2017-03-30 00:00:00','','2017-03-31',48,'2017-04-01',1),(15,'2017-04-01','dfsdfsdsfsd','dfsd','fsd','sdfsd','sdfsd','sdasd','sadsad\'','sdfsd','sfsd','sdas','das','dasd','LogoScopic New 1.png','','','','','','','','0000-00-00 00:00:00','','2017-04-01',42,'2017-04-01',42),(16,'2017-04-04','test','fgfdg','dfgdfg','dfgdfg','dfgdfg','dfgdfg','As a describer of life and manners, \r\nhe must be allowed to stand perhaps the first of the first rank. His humour, \r\nwhich, as Steele observes, is peculiar to himself, \r\nis so happily diffused as to give the grace of novelty to domestic scenes and daily occurrences. \r\nHe never \"o\'ersteps the modesty of nature,\" nor raises merriment or wonder by the violation of truth.\r\n His figures neither divert by distortion nor amaze by aggravation.\r\n He copies life with so much fidelity that he can be hardly said to invent; \r\nyet his exhibitions have an air so much original,\r\n that it is difficult to suppose them not merely the product of imagination','dfgdfg','dfgdfg','dfgdfg','dfgdfg','dfgdfg','Capture.JPG','','','','','','','','0000-00-00 00:00:00','','2017-04-04',1,'2017-04-04',1),(17,'2017-04-04','blackdog','dsd','dsdsd','dsd','dsd','sdsd','A common English usage misconception is that a paragraph has three to five sentences; single-word paragraphs can be seen in some professional writing, and journalists often use single-sentence paragraphs.[9]\r\n\r\nThe crafting of clear, coherent paragraphs is the subject of considerable stylistic debate. Forms generally vary among types of writing. For example, newspapers, scientific journals, and fictional essays have somewhat different conventions for the placement of paragraph breaks.\r\n\r\nEnglish students are sometimes taught that a paragraph should have a topic sentence or \"main idea\", preferably first, and multiple \"supporting\" or \"detail\" sentences which explain or supply evidence. One technique of this type, intended for essay writing, is known as the Schaffer paragraph. For example, the following excerpt from Dr. Samuel Johnson\'s Lives of the English Poets, the first sentence is the main idea: that Joseph Addison is a skilled \"describer of life and manners\". The succeeding sentences are details that support and explain the main idea in a specific way.\r\n','sdsd','sdsd','dsd','sdsd','sdsd','sssss.JPG','','','','','','','','0000-00-00 00:00:00','','2017-04-04',1,'2017-06-10',80),(18,'2017-04-04','testtt','dhgfdgh','dhdh','dfgdgh','dghdgh','dfh','Vodka (from Russian: Ð²Ð¾Ð´ÐºÐ° [ËˆvotkÉ™], Polish: wÃ³dka [Ëˆvutka]) is a distilled beverage composed primarily of water and ethanol, sometimes with traces of impurities and flavorings. Traditionally, vodka is made by the distillation of cereal grains or potatoes that have been fermented, though some modern brands use other substances, such as fruits or sugar.\r\n\r\nSince the 1890s, the standard Polish, Russian, Belarusian, Ukrainian, Estonian, Latvian, Lithuanian and Czech vodkas are 40% alcohol by volume ABV (80 US proof), a percentage that is widely misattributed to Dmitri Mendeleev.[1][2] The European Union has established a minimum of 37.5% ABV for any \"European vodka\" to be named as such.[3][4] Products sold as \"vodka\" in the United States must have a minimum alcohol content of 40%.[5] Even with these loose restrictions, most vodka sold contains 40% ABV. For homemade vodkas and distilled beverages referred to as \"moonshine\", see moonshine by country.\r\n\r\nVodka is traditionally drunk neat (not mixed with any water, ice, or other mixer), though it is often served chilled in the vodka belt countries (Belarus, Estonia, Finland, Iceland, Latvia, Lithuania, Norway, Poland, Russia, Sweden, Ukraine). It is also commonly used in cocktails and mixed drinks, such as the vodka martini, Cosmopolitan, vodka tonic, Screwdriver, Greyhound, Black or White Russian, Moscow Mule, and Bloody Mary.','dh','dhgfd','dh','dhd','dhfdh','Capture.JPG','dfhdfh','dfhdfh','dfh','dfh','dfh','dfh','dfh','2017-03-30 00:00:00','','2017-04-04',80,'2017-04-04',42),(19,'2017-04-04','fddffhgd','jhgjhgjh','hgjhgj','jhghjg','ghgg','ghhgh','jhgjhg','jhkjh','kjlkj','kjlkjlk','kjkljlkj','kjlkj','sssss.JPG','','','','','','','','0000-00-00 00:00:00','','2017-04-04',1,'2017-04-04',1),(20,'2017-04-04','adfdfa','adfda','adfad','adfd','dada','adda','adfda','da','adad','adfad','adfad','dafafd','6bba8df5-ef94-4dd8-b2fa-9c7a49f82439-large.jpeg','','','','','','','','0000-00-00 00:00:00','','2017-04-04',1,'2017-04-04',1),(21,'2017-04-04','weqweq,','eqw,','rwe','wqeqw','qweqw','wqeqw','wqeqweqe\'\'','sdas','sdas','adas','ada','adas','LogoScopic New 1.png','','','','','','','','0000-00-00 00:00:00','','2017-04-04',1,'2017-04-04',1),(22,'2017-04-04','hfjgj','ghjghj','ghjgh\'','ghjghhg','fghfg','fghf','ghfj\'','fghfgh','fghgfh','gfhfh','fghfh','fghfh','6bba8df5-ef94-4dd8-b2fa-9c7a49f82439-large.jpeg','','','','','','','','0000-00-00 00:00:00','','2017-04-04',1,'2017-04-06',1),(23,'2017-04-06','1118','jjlk','bacardi\'s\'s','bkhbh','bkbkh','bkb','kjbj','kjbkjb','kjbkj','kjbjkb','kjbkhjb','kjbkjj','Capture.JPG','','','','','','','','0000-00-00 00:00:00','','2017-04-06',1,'2017-04-06',80),(24,'2017-04-06','hgjh','hjghjg','hghg','hjghg','hh','hghjg','jhghg','hjghghg','hghjg','jhghjg','jghjg','jgh','Capture.JPG','','','','','','','','0000-00-00 00:00:0